private IEnumerator PreloadCoroutine(PooledObject[] objects)
    {
        long timeToYield = 33;
        var sw = new System.Diagnostics.Stopwatch();
        sw.Start();
        foreach(var obj in objects)
        {
            if (obj == null)
                continue;
            var inst = obj.GetPooledInstance<PooledObject>();
            if (inst != null)
                inst.ReturnToPool();
            if(sw.ElapsedMilliseconds > timeToYield)
            {
                yield return null;
                sw.Reset();
                sw.Start();
            }
        }
        sw.Stop();
    }
